import React from 'react'
import ReactDOM from 'react-dom'
import FootHeader from './Components/foot-header.js'
import Footer from './Components/footer.js'
import Carousel from './Components/Carousel.js'
import FooterNav from './Components/FooterNav.js'
import Articles from './Components/Articles.js'
import './styles.scss'
import Swiper from 'react-id-swiper'
import Slider from './Components/slider.js'
import News from './Components/news.js'
import 'slick-carousel/slick/slick.css'
import 'slick-carousel/slick/slick-theme.css'
import MainPage from './Components/MainPage'

class App extends React.Component {

  componentDidMount () {
    fetch('http://46.188.118.134:8082/navigations')
      .then(response => response.json())
      .then(response => {
        response
          .sort((a, b) => a.position === b.position ? a.subposition - b.subposition : a.position - b.position)
          .forEach(item => {
            const { type, name_ru, name_en, position, subposition } = item
            const articleId = item.hasOwnProperty('article') === true ? item.article.id : null
            if (this.navigations.has(type) === false) {
              this.navigations.set(type, new Map())
            }
            if (this.navigations.get(type).has(position) === false) {
              this.navigations.get(type).set(position, [])
            }
            this.navigations.get(type).get(position).push({
              name_ru,
              name_en,
              subposition,
              articleId
            })
          })
        this.setState({
          'showLoading': false
        })
      })
  }


  render () {
    return (

      <div>
        <section className='hero is-primary'>

          <div className='container'>
            <div className='navbar-brand'>
              <a>
                <img src='https://bulma.io/images/placeholders/128x128.png' />
              </a>
              <h1 className='title'>
                Факультет Международных образовательных программ МГТУ им. Н.Э.Баумана
              </h1>
            </div>
          </div>

          <div className='FootHeader'>
            <MainPage />
          </div>

        </section>

        <Carousel slides={[
          {
            'image': 'https://place-hold.it/500x500&text=slide1',
            'text': '1'
          },
          {
            'image': 'https://place-hold.it/500x500&text=slide2',
            'text': '2'
          }

        ]} />
        <Slider />
        <News />

        <FooterNav />

        <Footer />

      </div>

    )
  }
}

ReactDOM.render(

  <App />,
  document.getElementById('root'))
